import React from "react";

export default function Header() {
  const style = {
    display: "flex",
    justifyContent: "space-evenly",
    backgroundColor: "blue",
    width: "100%",
    height: "auto",
    color: "white",
  };
  const style2 = {
    display: "flex",
    justifyContent: "flex-start",
    alignItems: "center",
    width: "100%",
    paddingLeft: "2em",
  };
  const style3 = {
    display: "flex",
    justifyContent: "flex-end",
    alignItems: "center",
    width: "100%",
    paddingRight: "2em",
  };
  const style4 = {
    paddingTop: "0.6em",
    paddingBottom: "0.6em",
    paddingRight: "1.5em",
    paddingLeft: "1.5em",
    margin: "1em",

    backgroundColor: "yellow",
    border: "none",
    color: "blue",
  };

  function display() {
    window.alert("working on");
  }

  return (
    <header style={style}>
      <div style={style2}>
        <div>WE CART</div>
      </div>
      <div style={style3}>
        <a href="">
          <button style={style4} onClick={display}>
            Cart
          </button>
        </a>
      </div>
    </header>
  );
}
